import React from 'react';
import styled from "styled-components";
import { Inputs, Form, InlineForm, InputSeparator, DefaultInput } from "../form/inputs";

import {DefaultTextArea} from "../form/input-fields/primary-textarea";
import {Button} from "../form/buttons/primary-button";


const CustomDefaultTextArea = styled(DefaultTextArea)`
width:700px;
height:200px;
`;


const ContactUsForm = () => {
    return (
        <>
        <div>
                <InlineForm>
                    <DefaultInput
                        placeholder="Full name..."
                        id="fullname"
                    />

                    <DefaultInput placeholder="Email address..." id="emailaddress" />

                </InlineForm>
                <DefaultInput
                    placeholder="Subject"
                    id="subject"
                />

                <CustomDefaultTextArea
                    placeholder="Message"
                    id="message"
                />
            <div>
                <Button>Send Message</Button>
            </div>
            </div>
        </>
    );
}

export default ContactUsForm;
